import React from "react";
import { NavLink } from "react-router-dom";
import headerStyle from "../../styles/header/HeaderStyle";

const Header = () => {
  const activeStyleLink = { color: "blue" };

  return (
    <nav>
      <ul style={PheaderStyle.ulStyle}>
        <li style={headerStyle.liStyle}>
          <NavLink to="/" activeStyle={activeStyleLink} exact>
            Home
          </NavLink>
        </li>
        <li style={headerStyle.liStyle}>
          <NavLink
            style={headerStyle.aStyle}
            to="/covid"
            activeStyle={activeStyleLink}
          >
            Covid
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Header;
